import React from "react";

const logo = props => {
    const styles = {
        link: {
            marginLeft: "1rem;"
        },
        img: {
            display: "block",
            height: "100%",
            width: "1.8rem"
        }
    }

    return (
        <a href={props.link} className="btn btn-sm btn-primary" styles={styles.link}>
            <img src={props.src} style={styles.img}/>
        </a>
    )
};

export default logo;
